Door een tragedie krijgen vijf individuelen publieke aandacht. Dr. Andover wordt 
aangesproken om zijn expertise te verlenen en ze te helpen hun trauma's te overwinnen. 
Een jaar later leiden 'naschokken' van de gebeurtenis de overlevenden terug naar de kliniek,
zoekend naar antwoorden. Terwijl ze zich voorbereiden op hun beurt in de spreekkamer, 
is Dr. Andover ervan overtuigd dat er iets kwaadaardigs gaande is.

A doctor works to cure patients suffering from crippling phobias by 
placing them inside his invention which induces and controls hallucinations.


